Insert into PRODUCT values (10002,'Dish','New Kibble blend with green kibble. 100 percent complete and balanced nutrition','Our new kibble blend features the same variety of tastes and textures that always gets tails wagging-now with green kibble! This antioxidant-rich dry dog food contains high quality ingredients including vegetables plus 23 essential vitamins  minerals. And we naturally kept our signature mix of crunchy kibble and meaty bits making a delicious meal with complete and balanced nutrition that you can feel good about serving every day. After all when it comes to your four-legged family every bit counts.',20,'N',20,'images\3.PNG',1024);
Insert into PRODUCT values (10003,'KibblenBites','Great Meaty Taste and Big Cheese Flavor. 100% Complete and Balanced Nutrition for Adult Dogs','Ol Roy(R) Soft  Moist Beef  Cheese Flavored Dog Food helps satisfy your dogs craving for tasty beef flavor and yummy cheese. This moist and chewy meal treat has is packed with beef  cheese flavor. Plus, weve added vitamins and minerals for 100% balanced nutrition for adult dogs. Sam Walton loved his dogs. Especially his favorite bird dog Ol Roy."Roy was more of a pet than a bird dog," Sam used to say,"and I treated him like family." So, when Sam developed the dog food that would carry h Ol Roy Soft  Moist Beef  Cheese Flavor Dog Food, 72 Oz',30,'Y',30,'images\4.PNG',1025);
Insert into PRODUCT values (10004,'Puppy','100% Complete  Balanced Nutrition for dogs. With six crunchy  chewy pieces. Contains antioxidants for a healthy immune system. Savory Beef  chicken flavors','A happy, healthy dog starts from within. Bright eyes, a shiny coat and boundless amounts of energy are all traits of a happy, healthy dog. Ol Roy wants to help keep your dog at his best with their high-protein dog food. Thats why Ol Roy Kibbles, Chunks  Chews Savory Beef  Chicken Flavored Dog Food is specially formulated to provide 100 percent complete and balanced nutrition for all breeds. Ol Roy is made with wholesome ingredients like high-quality proteins, carbohydrates and fatty acids. No dog can resist Ol Roys delicious meaty taste its a taste your dog will crave and gobble up. And, the high-protein dog food is easy to digest so your dog gets all the nutrients he needs to live a long and healthy life. Try Ol Roy Kibbles Chunks  Chews Dog Food and see the difference in your dog.',40,'N',40,'images\5.PNG',1026);
Insert into PRODUCT values (10005,'RedFord','100% Complete and Balanced for Adult Dogs. 23 Essential Vitamins and Minerals. Highly Digestible Formula. Immune Health','FeaturesType - Pedigree beef combo dog foodIncludes 6 each of #01527 beef  #01508 country stew.12 countCapacity - 13.2 oz.Dimension - 3 x 3 x 4 in.Item Weight - 13.2 lbs. Contains twelve (12) 13.2-oz. cans of. PEDIGREE CHOICE CUTS in Gravy Combo Pack Beef and Country Stew Wet Dog Food Dogs will love this delectable dog food with hearty cuts of real meat in gravy for an irresistible country stew flavor PEDIGREE CHOICE CUTS Dog Food provides complete nutrition in a balanced dog food. Juicy, meaty dog food bites provide a soft texture for flavor and variety',50,'Y',50,'images\6.PNG',1023);
Insert into PRODUCT values (10006,'PrimeCuts','Meaty chunks in a delicious gravy dogs love. 6 cans of Beef. 6 cans of Country Stew. Optimal levels of oil and minerals','Give your dog the taste he craves while staying mindful of his weight with Purina Beneful Healthy Weight With Real Chicken adult dry dog food. With 10% fewer calories than Purina Beneful Originals With Real Beef and no added sugar, this premium dog food offers calorie-smart nutrition with a taste your dog can wag his tail for. Real farm-raised chicken as the number one ingredient adds a savory flavor and helps to deliver the protein he needs to maintain lean muscles. And accents of real apples, carrots and green beans provide variety and wholesome goodness for your dog. The mix of crunchy and tender kibble give him flavor and texture thats sure to have him running to his bowl at mealtime. Dont waste time and money on unsatisfying dog food he wont even want to touch. Instead, feed him Beneful Healthy Weight With Real Chicken for 100% complete and balanced nutrition and show your adult dog you care about his health and happiness.',60,'N',60,'images\7.PNG',1024);
Insert into PRODUCT values (10007,'Pedigree','Calorie-smart nutrition helps adult dogs maintain a healthy weight. High-quality protein, real chicken','Natural food for your dog with added vitamins and minerals. Rich in omega-3 and omega-6 fatty acids. Chelated minerals. Nutritionally complete and balanced. Ester-C source of vitamin C. Veterinarian recommended. Preserved naturally with vitamins E and C. No by-products, corn, soy, wheat and yeast. No fillers or added sugar. No artificial colors, flavors or preservatives. Rich in antioxidants. Next to nature. The PetGuard Commitment: Since 1979, PetGuard has practiced the philosophy, which embodies a commitment to you and your pets, to provide only natural alternatives for a healthier environment and lifestyle. People today are concerned with the important relationship between nutrition and health. We are all concerned about actual ingredient sources, seeking products free of artificial ingredients, by-products, colors, preservatives, excess sugars and salt. ',70,'Y',70,'images\8.PNG',1025);
Insert into PRODUCT values (10008,'Zignature','Natural food for your dog with added vitamins and minerals. Rich in omega-3 and omega-6 fatty acids. Chelated minerals','A happy and healthy dog starts from within. Bright eyes, a shiny coat and boundless amounts of energy are all traits of a happy, healthy dog. We want to help keep your dog at his best. Thats why Ol Roy is specially formulated to provide adult dogs 100 percent complete and balanced nutrition for all breeds. Ol Roy is made with wholesome ingredients like high-quality proteins, carbohydrates and essential fatty acids. No dog can resist Ol Roys delicious taste — its a taste your dog will crave and gobble up. Its easy to digest so your dog gets all the nutrients he needs to live a long and healthy life. Try Ol Roy T-Bone  Chicken Flavor Dog Food and see the difference in your dog. Each Ol Roy formula is fortified with vitamins and minerals to help promote overall health and longevity. A healthy dog is a happy dog. Healthy fat, containing linoleic acids, helps nourish your dogs skin and promote a shiny, healthy coat. ',80,'N',80,'images\9.PNG',1026);
Insert into PRODUCT values (10009,'Beneful','Nutritionally complete and balanced. Veterinarian recommended. Preserved naturally with vitamins E and C.','Healthy puppy food that tastes great too? No, its not too much to ask. When you give your dog Beneful Healthy Puppy, youre starting him off with 100 percent of the nutrients he needs to help him thrive every day. Plus DHA to help support healthy brain and vision development. Its everyday healthy and all kinds of yum. Beneful Healthy Puppy is part of Benefuls Purposeful Recipes line. Just because your puppy may benefit from a specific kind of nutrition doesnt mean he should have to sacrifice taste! We want ALL dogs to enjoy mealtime. And with our purposefully selected blends with good-for-him ingredients in a mix of tender and crunchy bites, were sure he will. Beneful Healthy Puppy Dry Dog Food is just one of the three varieties of purposeful recipes that provide that specific nutrition with all the taste your dog loves and you expect from Beneful. The calcium-rich nutrition helps support your puppys teeth and bones while DHA helps support brain and vision development.',90,'Y',90,'images\10.PNG',1023);
Insert into PRODUCT values (10001,'OlRay','For Health and Vitality. Bonus Size 3.2 lbs More Free. 100 percent Complete and Balanced','Grilled Steak and Vegetable Flavor Dog Food. Prepared with whole grains for healthy digestion,plus real meat protein,our steak-flavored dry dog food is designed to keep your adult dog feeling their best. This PEDIGREE Dry Dog Food is also formulated with essential nutrients and omega-6 fatty acids to promote healthy skin and a shiny coat. Now with no high fructose corn syrup,no artificial flavors,and no added sugar. Best of all,our tasty kibble for dogs features a unique crunchy texture to help clean your dogs teeth with every bite. So whether youre looking for a nutritious formula to promote health and vitality or you simply want to give your companion a great-tasting meal,PEDIGREE Adult Dry Dog food is a delicious way to care for your adult dog.',10,'Y',10,'images\11.PNG',1023);
