Insert into REVIEW values (4111,'Jacob Smith',3,'Good quantity at great price. I have a pregnant wife and I hate grocery shopping. So free shipping on heavy item such as this is a no-brainer.',10003);
Insert into REVIEW values (4100,'Carla Houston',3,'My fussy dog finds this food okay. Nothing completely satisfies her tastes unless its what I have planned for my own dinner. She likes this as well as most and we have tried many dry foods.',10001);
