Insert into REVIEW values (4107,'Brittany Lancaster',5,'This is my one go to food that i know my dogs will always eat it. They love it and they seem to be pretty healthy dogs.',10008);
Insert into REVIEW values (4108,'Audie Dewey',1,'The first ingredient is corn, dogs should not be eating this. Please dont feed your dog this terrible kibble. Invest in higher quality dog feed, your dogs health and diet is important.',10009);
Insert into REVIEW values (4109,'Nancy Perez',2,'Dog food as intended, like all dogs food is sensitive to their stomachs. Mine didnt react well to it.',10001);
