Insert into ANSWER values (90001,80001,'I''m not an expert, but I have a 47lb. German Shorthair and the piece size seems right for her. However, they strike me as large for the yorkies. ',1023);
Insert into ANSWER values (90002,80002,'Depends on cost of going to get it vers free delivery and also if you do the subscribe and save with Amazon so you get it auto shipped and if you get 15 percent of or 5. I get 15 and closest store is out of my way to require special trip so this is better deal for me. You need to figure it out for yourself. ',1024);
Insert into ANSWER values (90003,80003,'I have an 80lb blue heeled and one 35lb bag lasts eight weeks. ',1025);
Insert into ANSWER values (90004,80004,'It is hard with dried shredded chicken pieces. I cook sweet potatoes and mix rice with it and then when this is mixed with the food it softens the chicken pieces. ',1026);
Insert into ANSWER values (90005,80005,'I got a 35lb bag when I ordered it, to which my delivery man will sadly attest. ',1023);
Insert into ANSWER values (90006,80006,'Crude fiber content is 3%. Not sure if that helps answer your question or not. But I do know that there are high fiber dog foods out there. If you can''t find it you can always mix canned pumpkin into your dogs food to add additional fiber. ',1024);
Insert into ANSWER values (90007,80007,'The first ingredient listed is chicken, which is shredded and dehydrated. The kibble in the food is triangular. About two thirds of an inch on each side of the triangle. This may be to big for small dogs, but if you use water over it when feeding it might make it easier for a small dog to eat. I have a Border Collie (50 lbs) and I always use water when feeding. Hope this is helpful.',1025);
Insert into ANSWER values (90008,80008,'Could be an allergy ',1026);
